export default function Login() {
  return (
    <form className={styles['login-form']}>
      <h2>Login</h2>
      <label>
        <span>email:</span>
        <input 
        type="email" 
        />
      </label>
      <label>
        <span>password:</span>
      </label>
    </form>
  );
}
